(3, 1, '2018-11-06 21:53:48', '2018-11-06 21:53:48', '<h2>Who we are</h2><p>Our website address is: http://localhost/ArtusPT.com.</p><h2>What personal data we collect and why we collect it</h2><h3>Comments</h3><p>When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&#8217;s IP address and browser user agent string to help spam detection.</p><p>An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.</p><h3>Media</h3><p>If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p><h3>Contact forms</h3><h3>Cookies</h3><p>If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p><p>If you have an account and you log in to this site, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p><p>When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p><p>If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p><h3>Embedded content from other websites</h3><p>Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p><p>These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p><h3>Analytics</h3><h2>Who we share your data with</h2><h2>How long we retain your data</h2><p>If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.</p><p>For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.</p><h2>What rights you have over your data</h2><p>If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.</p><h2>Where we send your data</h2><p>Visitor comments may be checked through an automated spam detection service.</p><h2>Your contact information</h2><h2>Additional information</h2><h3>How we protect your data</h3><h3>What data breach procedures we have in place</h3><h3>What third parties we receive data from</h3><h3>What automated decision making and/or profiling we do with user data</h3><h3>Industry regulatory disclosure requirements</h3>', 'Privacy Policy', '', 'trash', 'closed', 'open', '', 'privacy-policy__trashed', '', '', '2018-11-20 01:55:40', '2018-11-20 01:55:40', '', 0, 'http://localhost/ArtusPT.com/?page_id=3', 0, 'page', '', 0),
(5, 1, '2018-11-17 04:29:04', '2018-11-17 04:29:04', 'a:7:{s:8:"location";a:1:{i:0;a:1:{i:0;a:3:{s:5:"param";s:4:"page";s:8:"operator";s:2:"==";s:5:"value";s:1:"2";}}}s:8:"position";s:6:"normal";s:5:"style";s:7:"default";s:15:"label_placement";s:3:"top";s:21:"instruction_placement";s:5:"label";s:14:"hide_on_screen";s:0:"";s:11:"description";s:0:"";}', 'Artus PT Text', 'artus-pt-text', 'publish', 'closed', 'closed', '', 'group_5bef98d92ea18', '', '', '2018-11-30 05:08:18', '2018-11-30 05:08:18', '', 0, 'http://localhost/ArtusPT.com/?post_type=acf-field-group&#038;p=5', 0, 'acf-field-group', '', 0),
(6, 1, '2018-11-17 04:30:07', '2018-11-17 04:30:07', 'a:10:{s:4:"type";s:8:"textarea";s:12:"instructions";s:0:"";s:8:"required";i:0;s:17:"conditional_logic";i:0;s:7:"wrapper";a:3:{s:5:"width";s:0:"";s:5:"class";s:0:"";s:2:"id";s:0:"";}s:13:"default_value";s:496:"Artus Physical Therapy specializes in orthopedic rehabilitation. We treat a wide variety of musculoskeletal conditions. Whether you are suffering with low back pain from sitting at a desk all day or need to get back to basketball after an ACL repair, we can help. We have a combined 25 years of experience and a state of the art facility to get you back into the best physical condition of your life. We spend the necessary time with each patient to identify the cause of the problem and cure it.";s:11:"placeholder";s:0:"";s:9:"maxlength";s:0:"";s:4:"rows";s:0:"";s:9:"new_lines";s:0:"";}', 'home_intro', 'home_intro', 'publish', 'closed', 'closed', '', 'field_5bef99169e90a', '', '', '2018-11-30 05:08:17', '2018-11-30 05:08:17', '', 5, 'http://localhost/ArtusPT.com/?post_type=acf-field&#038;p=6', 1, 'acf-field', '', 0),
(7, 1, '2018-11-17 04:31:15', '2018-11-17 04:31:15', 'a:10:{s:4:"type";s:8:"textarea";s:12:"instructions";s:0:"";s:8:"required";i:0;s:17:"conditional_logic";i:0;s:7:"wrapper";a:3:{s:5:"width";s:0:"";s:5:"class";s:0:"";s:2:"id";s:0:"";}s:13:"default_value";s:432:"Artus Physical Therapy does not use a simple protocol approach to our patient''s rehabilitation. Our goal is to look deeper at the underlying causes of the problem, so the condition can be properly treated and resolved without recurrence. This approach looks at the whole body and requires more time and clinical skill. We provide 45 minutes of one-on-one treatment and never leave our patients unsupervised to do rote gym exercises.";s:11:"placeholder";s:0:"";s:9:"maxlength";s:0:"";s:4:"rows";s:0:"";s:9:"new_lines";s:0:"";}', 'about_treatment', 'about_treatment', 'publish', 'closed', 'closed', '', 'field_5bef99612f5b2', '', '', '2018-11-30 05:08:17', '2018-11-30 05:08:17', '', 5, 'http://localhost/ArtusPT.com/?post_type=acf-field&#038;p=7', 7, 'acf-field', '', 0),
